                            <div class=""tab-content"" id=""pills-tabContent"">
                                <div cla");
                WriteLiteral(@"ss=""tab-pane fade show active"" id=""pills-home"" role=""tabpanel"" aria-labelledby=""pills-home-tab"">
                                    <h3 class=""tab-title"">Ürün Açıklaması</h3>
                                    <p>
                                        Oscar Claude Monet‘in 1873’te tamamladığı “Impression, Sunrise”, Fransa’daki La Havre Limanı’nda gündoğumunu göstermekte. Mavi ve sarının tonlarının kullanıldığı eser, ilk 1874 yılında sergilendi ve ‘olumsuz’ diyebileceğimiz eleştiriler aldı. Eleştirilerin sebebi, gün doğumunda La Havre‘nin böyle görünmemesiydi ve insanlar Monet’in aslını yapamayacak kadar yetenekten yoksun olduğunu düşündü. Lakin herkes yanlıştı; Monet, “Impression, Sunrise”ye gördüğü manzaradan aklında kalanı, ona hissettirdiklerini, belki de görmek istediklerini aktarmıştı ve daha sonra bu bir tarz olup adına ‘İzlenimcilik‘ denilecekti.
                                    </p>
                                    <p>
                                        Eser hakkında en çok yapıla");
                WriteLiteral(@"n yorum, ilk bakışta en dikkat çekici olan renk, yani ‘turuncu güneş’tir. Güneş, resimde en parlak görünen şey olarak algılansa da bu bir yanılgıdır. Beynimizde sürekli çalışan korteksler, bu resimdeki güneşin bize en parlak şey olduğunu algılamamızı sağlıyor. Ancak bu ışığın yanılsamasından başka bir şey değil. Güneş, en az bulutlar kadar parlak; sarı ve turuncu renklerin kullanımından dolayı en parlağıymış gibi algılıyoruz. Bunu, resmi siyah – beyaz yaparak görebilirsiniz. Bu ince nokta karşısında Monet’in yüce dehasına duyulan saygı kat be kat artmıştır.
                                    </p>
                                    <p>
                                        Orijinal ismi “Impression, Soleil Levant” olan yumuşak fırça darbeleriyle yapılan bu dinlendirici eserde La Havre Limanı‘nda sisli bir gün doğumunu gösteriyor. Biri ayakta kürek çeken iki kişinin içinde bulunduğu kayığın göründüğü denizin ilersinde bir kayık daha vr, ancak sisten net görünmüyor. Daha doğrusu Monet, o kayığı net göreme");
                WriteLiteral(@"miş ve bize böyle aktarmış. Gözlerinizi kıstığınızda daha iyi görebileceğiniz 48 x 63 cm ebatlarındaki bu tablo, Monet’in pek çok eserinin bulunduğu Paris, Marmottan Müzesi’nde sergileniyor.
                                    </p>
                                </div>
                                <div class=""tab-pane fade"" id=""pills-profile"" role=""tabpanel"" aria-labelledby=""pills-profile-tab"">
                                    <h3 class=""tab-title"">Sanatçının Hayatı</h3>
                                    <p>
                                        Adolphe ve Louise-Justine Monet’nin çocuğu olarak Paris’te dünyaya gelen sanatçı. Monet, Notre-Dame-de-Lorette kilisesinde Oscar-Claude olarak vaftiz edildi. Babası onun aile mesleği olan bakkallığa devam etmesini istiyordu, şarkıcı olan annesi ise Claude’ın sanatçı olmasını istiyordu.
                                    </p>
                                    <p>
                                        1851 nisanında, Monet Le Havre’da ortaokula ");
                WriteLiteral(@"başladı. Önceleri 10–12 Fransız frangı’na sattığı karakalem karikatürleriyle çevresinde tanınmaya başladı. İlk çizgi derslerini, Jacques-Louis David’in öğrencisi olan Jacques-Francois Ochard‘dan aldı. Bu dönemde, Eugène Boudin‘le tanıştı. Boudin Monet’e yağlı boya kullanmayı ve açık ortamlarda resim tekniğini öğretti.
                                    </p>
                                    <p>
                                        Louvre’u ziyaret etmek için Paris’e geldiğinde, pek çok ressamın eski ustaları taklit ettiğine tanık oldu. Monet, bir pencerenin yanına oturup gördüklerini resmetmektense, gereçlerini yanına alıp dışarıda resim yapmayı tercih ediyordu. Paris’te geçirdiği yıllarda pek çok empresyonist ressamla arkadaş olmuştu. Bunlardan biri Edouard Manet’ti.
                                    </p>
                                    <p>
                                        Haziran 1861’de Monet, yedi yıllık bir sözleşmeyle orduya katıldı, ancak görevinin ikinci yılında teyzesi Madame");
                WriteLiteral(@" Lecadre sözleşmesinin feshedilmesini sağladı. Madame Lecadre’in bir koşulu vardı: Monet’nin üniversitede sanat eğitimi almasıydı.
                                    </p>
                                    <p>
                                        1862’de Paris’te Charles Gleyre‘in öğrencisiyken, üniversitedeki geleneksel resim anlayışı Monet’de hayal kırıklığı yaratmıştı. Bu dönemde Pierre-Auguste Renoir, Frederic Bazille ve Alfred Sisley ile tanıştı. Birlikte resme yeni yaklaşımlarını paylaştılar, ışığın açık havada yarattığı etkiyi resme parçalanmış renkler ve seri fırça darbeleriyle aktardılar. Daha sonraları empresyonizm olarak adlandırılmıştı.
                                    </p>
                                    <p>
                                        Monet’nin tanınmasını sağlayan 1866 tarihli Camille ya da Yeşil Elbiseli Kadın (La Femme à la Robe Verte) adlı eseri, gelecekteki eşi Camille Doncieux‘nun Monet tarafından yapılmış pek çok resminden biriydi. Kısa süre sonra Doncieux ha");
                WriteLiteral(@"mile kaldı ve ilk çocukları Jean dünyaya geldi. 1868’de Monet, Seine nehrine atlayarak intihar etmeyi denemişti.
                                    </p>
                                    <p>
                                        Fransa Prusya Savaşı süresince (1870–1871) İngiltere’ye sığınan Monet, John Constable ve Joseph Mallord William Turner‘ın resimleri üzerinde çalıştı. Her ikisi de renk kullanımında Monet’in yenilikçi buluşlarına ilham kaynağı oldular.
                                    </p>
                                    <p>
                                        1870’de Monet ve Doncieux evlendiler. 1871–1878 yılları arasında Monet, Fransa’ya geri döndü. Önce çocukluğunun geçtiği La Havre kentine gitti. Le Havre’dan bir manzarayı yansıtan İzlenim: Gün doğumu (Impression, soleil levant) tablosunu yaptı. 1874’te ilk empresyonist sergide yer alan bu resim günümüzde Paris’te Musée Marmottan-Monet’dedir. Sanat eleştirmeni Louis Leroy, resmin adından yola çıkarak “izlenimcilik” (empresyon");
                WriteLiteral(@"izm) terimini, aşağılamak amacıyla ortaya atmıştır.
                                    </p>
                                    <p>
                                        1874 yılında Manet, Degas, Renoir, Cezanne, Pissaro, Sisley ile beraber açtıkları sergi başarısız oldu. Ancak Edouard Manet yardımıyla Argueille’de kalmayı sürdürebiliyordu. Bu dönemde resimleri hayatının başka hiçbir döneminde olmadığı kadar koyulaştı, kasvetli bir hal almıştı.
                                    </p>
                                    <p>
                                        Camille’in ölümünden sonra(1879) yas içindeki Monet, bir daha asla yoksulluk batağına düşmeme kararını vermişti ve en güzel eserlerini yaratmak için çaba harcamaya başladı. 1883-1908 yılları arasında, Akdeniz’i gezip pek çok doğa resmi yapmıştı.  Önemli bir resim serisini İtalya Venedik’te yapmıştır. Ayrıca Londra’da iki önemli serisi olan Parlamento ve Charing Cross Köprüsü (Charing Cross Bridge) resimlerini hazırlamıştı.
                ");
                WriteLiteral(@"                    </p>
                                    <p>
                                        Yeni eşi ve çocuklarıya beraber mayıs 1883’te Paris’ten 80 km. mesafedeki Giverny’e yerleştiler. Monet, burada bir ev ve bahçe kiraladı. Geri kalan ömrünün büyük kısmını sonradan satın aldığı bu yerde yeşerttiği bahçeyi resmederek geçirdi. İlk önce Ot yığınları serisini yaptı. Farklı yönlerden ve günün farklı saatlerinde ot yığınlarını resmetti. Son olarak da bahçesinin resmettiği Zambaklar serisini hazırladı.
                                    </p>
                                    <p>
                                        Monet, 1923’te katarakt sebebiyle iki kez ameliyat olmuştur. Katarakt olduğu süreçte yaptığı resimlerin genel olarak kırmızı tonlarda olduğunu genelde görürüz, bu katarakt hastalarının görüş biçiminin karakteristiğidir. Monet, 5 Aralık 1926’da, 86 yaşındayken akciğer kanseri nedeniyle ölmüş ve Giverny kilisesi mezarlığına gömüldü.
                                    </p>
